There's three possible method of providing authorization information when interacting with a registry. Each of these can be configured by the options > auth node in oro.kdl, with the node name being the registry the auth information applies to. Additionally, options > scoped-registries will be used to determine which registry auth should be picked for a particular package. For example: // oro.kdl
options { scoped-registries { "@mycompany" "https://my.company.registry.net" } auth { "https://registry.npmjs.org" token="deadbeef" "https://my.company.registry.net" username="myuser" password="mypassword" }
} When making any requests to a registry, configured credentials will always be automatically included in the Authorization header, encoded appropriately. Authorization will also take into account scopes when fetching or pushing individual packages and their metadata. When package tarballs are hosted on a separate registry than the package's configured registry (as determined by its scope or lack thereof), authorization information will not be sent.

21.body:
This is usually acquired through a login operation with the registry, and is the preferred and more secure way of managing authorization. Bearer token auth will be sent in the form of an HTTP header that looks like: Authorization: Bearer deadbeefbadc0ffee You can configure a bearer token using oro login by either invoking it as-is, in which case you will be taken through an actual login flow with the registry, or you can pass a --token <token> option directly to skip this, if you already have a known token. You can also pass --auth-type legacy to log in using classic command-line-prompt username/password instead of web-based login. Unlike the main NPM CLI, an email is not collected, and a new account cannot be create using oro login. Given an invocation like oro login --registry https://my.custom.registry.net --scope @mycompany, you will be taken to that registry's login page, and, when done, your oro.kdl will look something like this: // oro.kdl
options { scoped-registries { "@mycompany" "https://my.custom.registry.net" } auth { "https://my.custom.registry.net" token="deadbeef" }
} In NPM CLI terms, this maps to :_authToken and :token, which are synonyms.

